import axios from 'axios';
import React, {Component} from 'react';
import AllSongsTable from './components/AllSongsTable/AllSongsTable';

class App extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            songs: []
         }
    }

    componentDidMount(){
        axios.get('http://127.0.0.1:8000/music/')
        .then(response => this.setState({
            songs: response.data
        }))
    }

    async createSong(){
        let response = await axios.post('http://127.0.0.1:8000/music/');
        let tempSong = this.state.songs;
        tempSong.push(response.data);
        this.setState({
            songs: tempSong
        })
    }

    render() { 
        return ( 
            <div>
                <h1>Hello</h1>
                <AllSongsTable songList={this.state.songs} />
            </div>
         );
    }
}

export default App;
